import React from "react";
import styled from "styled-components";
import { saturate } from "polished";

const Head = () => <MainHead> Contact Us</MainHead>;

const MainHead = styled.h1`
  color: ${saturate(0.1, "#0E054D")};
  font-weight: 900;
  font-size: 3em;
  line-height: 2em;
`;

export default Head;
